import React from "react";
import { View, Text, Image } from "react-native";

export default function Login() {
  return (
    <View
      style={{ flex: 6, justifyContent: "flex-start", alignItems: "center" }}
    >
      <View style={{ flex: 2, backgroundColor: "blue" }}>
        <Image
          style={{
            width: 150,
            height: 150,
          }}
          source={require("../screens/images/log.jpg")}
        />

        <Text style={{ color: "black" }}> Welcome </Text>
      </View>
      <View style={{ felx: 1, backgroundColor: "red" }}></View>
    </View>
  );
}
